var rateById = {};
var nameById = {};

var color_domain = [50, 150, 350, 750, 1500]
var ext_color_domain = [0, 50, 150, 350, 750, 1500]
var legend_labels = ["< 50", "50+", "150+", "350+", "750+", "> 1500"]

var color_domain2 =[1000, 2000,3000,4600, 6400, 8200,10000,11800,13600,15400,17200]
var ext_color_domain2 = [0, 1000, 2000,3000,4600, 6400, 8200,10000,11800,13600,15400,17200]
var legend_labels2 = ["< 1000", "1000+", "2000+","3000+", "4600+", "6400+", "8200+", "10000+", "11800+", "13600+", "15400+", "17200+"]

var color;
var color2;

var jdata=jtrus; 
var map=jtrus;			

var path2;
		
var jwidth=1000;
var jheight=700;



function mapCreate(){
		
	console.log("map");
	console.log(colorSet);
	
	 color  = d3.scale.threshold()
	.domain(color_domain)
	.range([colorSet[13],colorSet[14],colorSet[15],colorSet[16],colorSet[17],colorSet[18],colorSet[19],colorSet[20]] 
	);		      		

	
	
	var divTooltip = d3.select("body").append("div")
	.attr("class", "tooltip")
	.style("opacity", 0);
	

	accdata.forEach(function(d) {
	rateById[d.RegionCode] = +d.Deaths;
	nameById[d.RegionCode] = d.RegionName;
	});
	
	console.log("mapCreate");
	console.log(jdata);
	
	//svg.slectAll("*").remove();
	svg.remove();		
	svg = d3.selectAll("body").append("svg").attr("width",jwidth+200).attr("height",jwidth+100);
	
	var svgWidth=960,
	svgHeight=1160;
			
	
	var jsvg = d3.select("body").append("svg")
	.attr("width", jwidth)
	.attr("height", jheight);
	
	var path = d3.geo.path();
	path2= d3.geo.path().projection(d3.geo.equirectangular());
	
	var projection = d3.geo.albers()
	.rotate([-105, 0])
	.center([-80, 65])
	.parallels([52, 64])
	.scale(700)
	.translate([jwidth / 4, jheight / 4]);

	path2=d3.geo.path().projection(projection);
	
			
	svg.append("g")
	.attr("class", "region")
	.selectAll("path")
	//.data(topojson.object(map, map.objects.russia).geometries)
	.data(topojson.feature(map, map.objects.russia).features) //<-- in case topojson.v1.js
	.enter().append("path")
	.attr("d", path2)
	.style("fill", function(d) {
	return color(rateById[d.properties.region]); 
	})
	.style("opacity", 1)

	//Adding mouseevents
	.on("mouseover", function(d) {
		toolOver(d,d3.select(this));
	})
	.on("mouseout", function(d) {
		toolOut(d,d3.select(this));
	})
	.on("mousemove", function(d) {
		toolMove(d,d3.select(this));
	})
	;
	
	
	
	city = svg.selectAll("g.city")
	.data(citydata)
	.enter()
	.append("g")
	.attr("class", "city")
	.attr("transform", function(d) { return "translate(" + projection([d.lon, d.lat]) + ")"; });
	
	
	city.append("circle")
	.attr("r", 3)
	.style("fill", "lime")
	.style("opacity", 0.75);

	city.append("text")
	.attr("x", 5)
	.text(function(d) { return d.City; });

	var legend = svg.selectAll("g.legend")
	.data(ext_color_domain)
	.enter().append("g")
	.attr("class", "legend");

	var ls_w = 20, ls_h = 20;

	legend.append("rect")
	.attr("x", 20)
	.attr("y", function(d, i){ return jheight - (i*ls_h) - 2*ls_h;})
	.attr("width", ls_w)
	.attr("height", ls_h)
	.style("fill", function(d, i) { return color(d); })
	.style("opacity", 0.8);

	legend.append("text")
	.attr("x", 50)
	.attr("y", function(d, i){ return jheight - (i*ls_h) - ls_h - 4;})
	.text(function(d, i){ return legend_labels[i]; });


}



function mapRec(){

	rateById=[];
	nameById=[];

	accdata2.forEach(function(d) {
	rateById[d.RegionCode] = +d.Deaths;
	nameById[d.RegionCode] = d.RegionName;
	});
	
	svg.selectAll("path").remove();
	svg.selectAll("g.legend").remove();
	
	color  = d3.scale.threshold()
	.domain(color_domain2)
	.range([colorSet[13],colorSet[14],colorSet[15],colorSet[16],colorSet[17],colorSet[18],colorSet[19],colorSet[20],colorSet[21],colorSet[22],colorSet[23],colorSet[24]] 
	);	
	
	svg.selectAll("*").remove();
	
	svg.append("g")
	.attr("class", "region")
	.selectAll("path")
	//.data(topojson.object(map, map.objects.russia).geometries)
	.data(topojson.feature(map, map.objects.russia).features) //<-- in case topojson.v1.js
	.enter().append("path")
	.attr("d", path2)
	.style("fill", function(d) {
	return color(rateById[d.properties.region]); 
	})
	.style("opacity", 1)

	//Adding mouseevents
	.on("mouseover", function(d) {
		toolOver(d,d3.select(this));
	})
	.on("mouseout", function(d) {
		toolOut(d,d3.select(this));
	})
	.on("mousemove", function(d) {
		toolMove(d,d3.select(this));
	})
	;
		
	
	legend = svg.selectAll("g.legend")
	.data(ext_color_domain2)
	.enter().append("g")
	.attr("class", "legend");

	ls_w = 20, ls_h = 20;

	legend.append("rect")
	.attr("x", 20)
	.attr("y", function(d, i){ return jheight - (i*ls_h) - 2*ls_h;})
	.attr("width", ls_w)
	.attr("height", ls_h)
	.style("fill", function(d, i) { return color(d); })
	.style("opacity", 0.8);

	legend.append("text")
	.attr("x", 50)
	.attr("y", function(d, i){ return jheight - (i*ls_h) - ls_h - 4;})
	.text(function(d, i){ return legend_labels2[i]; });
		
}


function toolOver(d,i)
{
console.log("mouseOver");

	i.transition().delay(100).duration(250).style("fill", "rgb(240,240,240)").style("stroke","orange").style("stroke-width","2"+"px");

	divTooltip.transition().duration(300).style("opacity", 1);

	divTooltip.text(nameById[d.properties.region] + " : " + rateById[d.properties.region])
	.style("left", (d3.event.pageX) + "px")
	.style("top", (d3.event.pageY -100) + "px")
	;
	
}

function toolMove(d,i)
{
	divTooltip.text(nameById[d.properties.region] + " : " + rateById[d.properties.region])
	.style("left", (d3.event.pageX) + "px")
	.style("top", (d3.event.pageY -100) + "px")
	.style("color","blue");
}

function toolOut(d,i)
{
	console.log("mouseOut");

	i.transition().delay(50).duration(1000).style("fill", function(d) {return color(rateById[d.properties.region]); 
	})
	.style("stroke","white").style("stroke-width","1"+"px")
	;	

	divTooltip.transition().duration(300).style("opacity", 0); 

}


